// src/pages/PrivacyPolicy.js
import React from 'react';

const PrivacyPolicy = () => {
  return (
    <div className="p-8">
      <h1 className="text-3xl font-bold">سياسة الخصوصية</h1>
      <p className="mt-4">هنا يمكنك إضافة محتوى سياسة الخصوصية الخاصة بك.</p>
    </div>
  );
};

export default PrivacyPolicy;
